import React from "react";
import styled from "styled-components";

const FormStyled = styled.div``;

const Form = () => {
  return (
    <FormStyled>
      <form action="">
        <div className="form-group">
          <label htmlFor="name">Name</label>
          <input type="text" id="name" name="name" />
        </div>
      </form>
    </FormStyled>
  );
};

export default Form;
